'use strict';
let AliveController = require('./AliveController.js');
let AlivePriceController = require('./AlivePriceController.js');
class AliveControllerFactory {
    create(commandFactory, connectionParameters, sessionProvider, messageFactory, messageExecutor, messageRouter, connectionStatusManager, requestNumberGenerator, periodInMilliseconds, controllersBreaker) {
        let keepAliveCommand;
        keepAliveCommand = commandFactory.createKeepAliveCommand(periodInMilliseconds, connectionParameters, messageRouter, messageExecutor, messageFactory, requestNumberGenerator);
        return AliveController.create(sessionProvider, messageRouter, connectionStatusManager, keepAliveCommand, controllersBreaker);
    }
    createAlivePrices(commandFactory, connectionParameters, sessionProvider, messageFactory, messageExecutor, messageRouter, requestNumberGenerator, periodInMilliseconds, priceTerminal, alivePriceControllerCallback) {
        let keepAliveCommand;
        keepAliveCommand = commandFactory.createKeepAlivePricesCommand(periodInMilliseconds, connectionParameters, messageRouter, messageExecutor, messageFactory, requestNumberGenerator, priceTerminal);
        return AlivePriceController.createPriceController(sessionProvider, messageRouter, keepAliveCommand, alivePriceControllerCallback);
    }
}
module.exports = AliveControllerFactory
